INSERT INTO `youthchina`.`COM_ESSAY` (`ESSAY_ID`, `ESSAY_TITLE`, `ESSAY_ABBRE`, `ESSAY_BODY`, `USER_ANONY`, `ESSAY_PUB_TIME`, `ESSAY_EDIT_TIME`, `IS_DELETE`, `IS_DELETE_TIME`) VALUES ('1', '翟天临们，放过博士学位吧', '翟天临道歉了，北京电影学院撤销了其博士学位，导师陈浥也被取消博导资格。', '\"这只是针对《谈电视剧[白鹿原]中“白孝文”的表演创作》一文问题的查处结果单就这个问题所作的查处结果对陈邑和翟天临来说很合适。一起观望后续其他问题的查处结果唯一需要担心的是，北电别有用心，先抛出这个结果来试探全国广大网民的对翟天临事件的较真程度如果网民们较真，北电只需要回应这只是这个问题的查处结果，其他问题正在查处中如果网名们淡忘了，热度消失了，公众麻木了，不感兴趣了这起事件淡出了公众的视线那么后续相关问题可能慢慢地就不了了之了而后续相关问题即翟天临如何能通过北电学术委员会和答辩委员会的评审以及这其中是否存在拉帮结派利益勾结，才是翟天临事件的重中之重，也是北电最为害怕公之于众的所以最后望广大学术一线人员苟富贵，莫相忘哈哈哈\n\"', '1', '2019-01-01 00:00:00', '2019-01-01 00:00:00', '0', '2019-01-01 00:00:00');
INSERT INTO `youthchina`.`COM_ESSAY` (`ESSAY_ID`, `ESSAY_TITLE`, `ESSAY_ABBRE`, `ESSAY_BODY`, `USER_ANONY`, `ESSAY_PUB_TIME`, `ESSAY_EDIT_TIME`, `IS_DELETE`, `IS_DELETE_TIME`) VALUES ('2', '为什么富人会越富，穷人还是穷人？', '依据我身边的经验，在二三线城市的年轻人，月薪基本会稳定在四千左右。', '依据我身边的经验，在二三线城市的年轻人，月薪基本会稳定在四千左右。我是山东的，山东这边拿得上台面的城市，就举青岛吧，认识的一个做房产销售的姑娘，从济南打拼到青岛，天天加班，工资在五六千左右。一个朋友做摄影的工作室，作为领头人，工资也才拿四千多。而在发达一些的地方，同等资质的年轻人，月薪大概会翻番。我一个朋友跟我讲她的小闺蜜，在深圳做文员，连ppt也做不好的主儿，在深圳拿六千。而题主你在知乎见到的月薪过万的，大多数是有点儿本事的那种。我一个学妹就这种人，有点儿本事，上大学的时候就很活跃，毕业去了北京做金融，月薪好像刚去就过万了。她的朋友圈和知乎里那些大神一样，天天就是配个苹果在咖啡厅里在办公室里写表格，要不然就是新马泰旅游，还养了只拉布拉多。去年人家还结婚了，在北京，据说是男友炒股挣了钱。所以我觉得月薪过万不算普遍。第一月薪过万，得满足你有本事或者踩了狗屎，或者有本事到随便踩狗屎。会钻营，会取巧，会吃苦，会进取，哪一样干到极致，月薪过万都不是梦。有能耐，到哪儿都吃香。而我们很大一部分人，既没有本事，也没把握好环境。有的人北京待好几年工资都上不了五位数，有的人就能。这没法说，成功的途径很多，但哪一条路都不会特别好走。第二是行业的问题。恕我见识少，我是没见过技术要求低的岗位上出现过月薪过万的人。平时打个表格的小职员，公司呼来喝去的，哪能过万啊。你看那些发帖的，做销售的，干工程的，自主创业的，哪有个街道清洁的的出来说自己月薪过万。而从目前的环境看，技术要求低的岗位，仍然是主流啊，毕竟是基层。基层待遇好了，谁还想着往上爬啊是吧。第三就是某些答主金玉其外败絮其中了。不少人有虚荣心，无可厚非，但很多人的虚荣心和本身的价值不匹配。你说你用的是苹果嘴上抹的是YSL挎的是香奈儿去的是游轮度假，家里摆的是顶配电脑外加所有主机约的是极品大长腿，可有多少是真正靠自己，不是靠着家庭背景和另一半得来的，有多少是在自己月薪过万的承受范围内得来的。有的人，父母给买套房觉得是自己的，另一半给买到购物车清空觉得是自己的，还着上万的花呗觉得是自己的。拜托，吃了上顿没下顿的主儿，自己心里没点儿数是怎么着。还有我觉得最重要的是，普遍这个词儿怎么定义。我是觉得，十个人里面，一个人月薪过万我就认为这事儿普遍了。但现在的情况是，十亿人里，有几十万人挣得多，在社交圈子里一晒，人们就觉得普遍。网络拉近了人们的距离，也拉低了人们的智商和下限。综上，我觉得不算普遍。月薪过万的人虽然很多，真的很多。但这世上，多的还是苟且着的普通人。以上都是一家之言，冒犯了诸位，请多包涵。数据对不对的，反正我这个没见过什么世面的人，对于身边的感触就是这样，错了也没法改咯。在知乎灌水一年，看惯了某些人的沾沾自喜，多少有些反胃。人与人之间的交往，本不该有这么多的优越感。大家开开心心地坐在苞谷地里一块儿聊聊天喝喝酒多好。非得坐在埃菲尔铁塔尖儿上冻屁股，我还跟你喝酒呢，去你的吧。', '0', '2019-01-01 00:00:00', '2019-01-01 00:00:00', '0', '2019-01-01 00:00:00');
INSERT INTO `youthchina`.`COM_ESSAY` (`ESSAY_ID`, `ESSAY_TITLE`, `ESSAY_ABBRE`, `ESSAY_BODY`, `USER_ANONY`, `ESSAY_PUB_TIME`, `ESSAY_EDIT_TIME`, `IS_DELETE`, `IS_DELETE_TIME`) VALUES ('3', '你听过最美的网名是什么？', '各位看官 大家好? 我的这个回答是我在好多地方搜集到的 欢迎转载（ps不太接受商用呦 ） 不过尽量知会我一声呦', '1 Pluto.（冥王星）  太阳系中离太阳最遥远的星星  几乎没有阳光能穿越59亿公里的旅程找他  有颗同力矮行星叫做卡戎(Charon)的距离只有地球和月球距离的十五分之一  她一直陪着冥王星走着这一段冷清的旅程  每一个Pluto都有他的Charon2 427℃           -173℃  水星  温差最大的行星  白天最高达427℃  夜晚最低零下173℃近在咫尺  触不可及你望一眼  我便可以兴奋到427℃你转过身  我也可以忍受零下173℃的冰冷3 37.2℃  人的正常温度是37℃  而遇到喜欢的人后就会增长到37.2℃4 TiAmo  在意大利语中是我爱你  在法语中却是我爱过你  当我遇见你的那一天  我希望是在意大利5 Agoni  法语是痛苦的意思  中文发音却是爱过你（4和5好像不太对   不学法语的大一狗表示很抱歉   但是布吉岛为啥就是不想删    所以大家看看就好哈 ）6 长安某  世人谓我恋长安  其实只恋长安某7 清欢渡  你有你的清欢渡我有我的不归途8 扶苏  姑苏一杯倒  夷陵见狗怂9 拾柒  无人为我挡枪口就做自己的英雄10撒野  我要赢一壶酒  拿来娶你11水下月  海底月是天上月  眼前人是心上人12西洲  南风知我意  吹梦到西洲13南川   北鱼  南有西川  北冥有鱼14 嘉木  相思', '0', '2019-01-01 00:00:00', '2019-01-01 00:00:00', '0', '2019-01-01 00:00:00');
